import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";

const pageOne = () => {
  return <div>Page One</div>;
};

const pageTwo = () => {
  return <div>Page Two</div>;
};

const App = () => {
  return (
    <div>
      <Routes>
        <Route path="/" exact component={pageOne} />
        <Route path="/pageTwo" component={pageTwo} />
      </Routes>
    </div>
  );
};

export default App;
